import { useEffect, useState } from "react";
import Tile from "./Tile";

function DateList() {
  const [dates, setDate] = useState([]);

  useEffect(() => {
    fetch("/dates")
      .then((r) => r.json())
      .then((dates) => setDate(dates));
  }, []);

  const handleAddDate = (date) => {
    setDate([date, ...dates]);
  };

  return (
    <>
      <Tile dates={dates} />
    </>
  );
}

export default DateList;

